import './App.css';
import MainPage from "./components/MainPage/MainPage";
import AddInformation from "./components/AdditionalInformation/AddInformation";
import {BrowserRouter, Route} from "react-router-dom";

function App() {

    return (
        <BrowserRouter>
            <div className="App">
                <div className='AppHeader'>Header</div>
                <div>
                    <Route path='/additionalInformation/:itemId' render={() => <AddInformation/>}/>
                    <Route path='/mainPage' render={() => <MainPage/>}/>
                </div>
            </div>
        </BrowserRouter>
    );
}

export default App;
